import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';


class Display extends React.Component {
	constructor(props) {
		super(props);
	}
}

function NumberSection(props) {
	return(
		<div>
			<button className="btnNumber" onClick={props.onClick()}>
				7
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				8
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				9
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				4
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				5
