			<button className="btnNumber" onClick={props.onClick}>
				2
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				3
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				0
			</button>
			<button className="btnNumber" onClick={props.onClick}>
				.
			</button>
		</div>
	);
}

function OperatorButton(props) {
	return(
		<button className="btnOperator" onClick={props.onClick}>
			{props.value}
		</button>
	);
}

class Calculator extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			number: 0.0,
			operator: null,
		}
	}
	render() {
		return (
			<div className="calculatorBoard">
